import React from 'react';
import ReactDOM from 'react-dom/client';
import Header from './Header';
import Main from './Main'
import Main2 from './Main2'
import './Main.scss'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Header />
    <Main className = "Main" />
    <Main2 />
  </React.StrictMode>
)
